import React, { useEffect, useState } from 'react'

export default function Table1({data}) {
   const [s1,sets1] = useState('Nodata')
  useEffect(
    (data) => {
      let tr = "";
      let count = 0;
      data.map((v)=>{
         tr += <tr><td>${count+1}</td><td></td><td>${v.name}</td><td>${v.age}</td><td>${v.email}</td><td><button type="button" class="btn btn-primary">update</button></td><button type="button" class="btn">delete</button></tr>
      })
      return sets1(tr)

    },[data]
  )
  return (
    <table className="table table-hover">
    <thead>
    <tr>
        <th>S.no</th>
        <th>Name</th>
        <th>Age</th>
        <th>Email</th>
        <th>Edit</th>
        <th>Remove</th>
    </tr>
    </thead>
    <tbody>
     {s1}
    </tbody>
  </table>
  )
}
